def lemonade_change(bills):
    balance = {5: 0, 10: 0, 20: 0}
    for bill in bills:
        if bill == 10:
            if balance[5] >= 1:
                balance[5] -= 1
            else:
                return False
            balance[bill] += 1

        elif bill == 20:
            if balance[10] >= 1 and balance[5] >= 1:
                balance[10] -= 1
                balance[5] -= 1
            elif balance[5] >= 3:
                balance[5] -= 3
            else:
                return False
            balance[bill] += 1

        else:
            balance[5] += 1

    return True


